import axios from 'axios';

export const initUrl = 'https://rickandmortyapi.com/api/character';

export const fetchAPI = async () => {
  await axios
    .get(initUrl)
    .then((response) => {
      const { data } = response;
      return data;
    })
    .catch((error) => {
      console.error(error);
    });
};
